INSERT INTO `tabDict` (`id`, `pt`, `en`, `fr`, `es`) VALUES
(63, 'A missão desta empresa é estar preparada e preparar para um futuro que será não ser preciso pagar para comer o essencial. Um futuro destes é bastante provável segundo Daniel Chanfana dos Santos, CEO da Vivision.', 'The mission of this company is to be prepared and prepare for a future that will be not having to pay to eat essentials. Such a future is very likely according to Daniel Chanfana dos Santos, CEO of Vivision. ', 'La mission de cette entreprise est de se préparer et de préparer un avenir qui ne sera pas d\'avoir à payer pour manger l\'essentiel. Un tel avenir est très probable selon Daniel Chanfana dos Santos, PDG de Vivision. ', 'La misión de esta empresa es estar preparados y prepararse para un futuro en el que no tendrá que pagar para comer lo imprescindible.. Ese futuro es muy probable según Daniel Chanfana dos Santos, CEO de Vivision. '),
(64, 'Plano de combate à fome', 'Plan to fight hunger', 'Plan pour lutter contre la faim', 'Planifica combatir el hambre'),
(65, 'máquinas perto', 'machines close', 'les machines se ferment', 'las maquinas cierran'),
(66, 'entrar', 'to enter', 'entrer', 'entrar'),
(67, 'carregar', 'to charge', 'charger', 'para cargar'),
(68, 'Saldo', 'Balance', 'Équilibre', 'Equilibrio'),
(69, 'Ao comprar batatas doces assadas por aqui, está a salvar pessoas da fome.', 'By buying baked sweet potatoes around here, you are saving people from hunger. ', 'En achetant des patates douces cuites au four ici, vous sauvez les gens de la faim. ', 'Al comprar batatas horneadas por aquí, estás salvando a la gente del hambre. '),
(70, 'As máquinas que vendem são portateis podendo se colocar em qualquer sitio que apanhe sol.', 'The machines they sell are portable and can be placed anywhere that catches the sun. ', 'Les machines qu\'ils vendent sont portables et peuvent être placées n\'importe où qui attrape le soleil. ', 'Las máquinas que venden son portátiles y se pueden colocar en cualquier lugar que reciba el sol.. '),
(71, 'Cada maquina doa 100€ por mês em batata doce assada para 5 pessoas em carência social.', 'Each machine donates €100 per month in roasted sweet potatoes for 5 people in need. ', 'Chaque machine donne 100€ par mois en patates douces rôties pour 5 personnes dans le besoin. ', 'Cada máquina dona 100 € al mes en boniatos asados ​​para 5 personas necesitadas. '),
(73, 'Os lucros das vendas das batatas doces assadas são todos para crescimento da organização e para espalhar pelo mundo.', 'Profits from sales of baked sweet potatoes are all for the organization\'s growth and to spread around the world.. ', 'Les bénéfices des ventes de patates douces cuites au four sont tous destinés à la croissance de l\'organisation et répartis dans le monde entier.. ', 'Las ganancias de las ventas de batatas horneadas son todas para el crecimiento de la organización y se extienden por todo el mundo.. '),
(74, 'Com a ajuda de todos que tenham fé que este projeto funcione, vamos conseguir.', 'With the help of everyone who has faith that this project works, we will succeed. ', 'Avec l\'aide de tous ceux qui croient que ce projet fonctionne, nous réussirons. ', 'Con la ayuda de todos los que tienen fe en que este proyecto funciona, lo lograremos. '),
(75, 'Que máquinas são estas?', 'What machines are these?', 'De quelles machines s\'agit-il ?', '¿Qué máquinas son estas?'),
(76, 'São estufas que produzem batata doce com sistema automático que assa as batatas, ficando prontas ao consumo.', 'They are greenhouses that produce sweet potatoes with an automatic system that roasts the potatoes, ready for consumption. ', 'Ce sont des serres qui produisent des patates douces avec un système automatique qui rôtit les pommes de terre, prêtes à la consommation. ', 'Son invernaderos que producen boniatos con un sistema automático que asa las patatas, listas para su consumo.. '),
(77, 'As pessoas compram as batatas directamente nas máquinas, reduzindo assim a pegada ecologica do transporte.', 'People buy potatoes directly from the machines, thus reducing the ecological footprint of transport.. ', 'Les gens achètent des pommes de terre directement aux machines, réduisant ainsi l\'empreinte écologique du transport.. ', 'La gente compra patatas directamente de las máquinas, reduciendo así la huella ecológica del transporte.. '),
(78, '  ', '', '', ''),
(79, 'Máquinas a colocar perto de si', 'Machines to be placed near you', 'Machines à placer près de chez vous', 'Máquinas para colocar cerca de usted'),
(80, 'As máquinas vão ser espalhadas pelo mundo, pelo que serão todas listadas aqui.', 'The machines will be spread around the world, so they will all be listed here. ', 'Les machines seront réparties dans le monde entier, elles seront donc toutes répertoriées ici. ', 'Las máquinas se distribuirán por todo el mundo, por lo que todas se enumerarán aquí.. '),
(81, 'Futuras localizações estimadas', 'Estimated future locations', 'Emplacements futurs estimés', 'Ubicaciones futuras estimadas'),
(83, 'Doamos 20€ todos os meses a quem esteja inscrito na acçao social perto de cada máquina em acordo com a camara municipal.', 'We donate €20 every month to anyone who is registered for social action near each machine in agreement with the city council.', 'Nous reversons 20€ chaque mois à toute personne inscrite à l\'action sociale à proximité de chaque machine en accord avec la mairie.', 'Donamos 20 € cada mes a cualquier persona que esté inscrita en acción social cerca de cada máquina de acuerdo con el ayuntamiento.'),
(84, 'There is a plan to put a machine near you:', 'There is a plan to put a machine near you:', 'Il y a un plan pour mettre une machine près de chez vous :', 'Hay un plan para poner una máquina cerca de usted:'),
(85, 'enter', 'enter', 'Entrer', 'ingresar'),
(86, 'There is a plan to put a machine near you', 'There is a plan to put a machine near you', 'Il y a un plan pour mettre une machine près de chez vous', 'Hay un plan para poner una máquina cerca de ti.'),
(87, 'Congratulations, there is a plan to put a machine near you', 'Congratulations, there is a plan to put a machine near you', 'Félicitations, il y a un plan pour mettre une machine près de chez vous', 'Enhorabuena, hay un plan para poner una máquina cerca de ti.'),
(88, 'near machines', 'near machines', 'près des machines', 'cerca de maquinas'),
(89, 'charge', 'cartoon', 'dessin animé', 'dibujos animados');
